import React, { useEffect, useState } from 'react';
import axios from 'axios'
const HotelList = () => {
  const [hotels, setHotels] = useState([]);

  useEffect(() => {
    const fetchHotels = async () => {
      try {
        const response = await axios.get('/api/businesses/search', {
          headers: {
            "accept": "application/json",
        "x-requested-with": "xmlhttprequest",
        "Access-Control-Allow-Origin":"*",
            Authorization: `Bearer LfhBitTkiuZedbK7hkFZ8QQBkuAfkJmrhbRaE53OIFdehe8Gcw0NDNADJb1Hi-TQtSjM890N13UDhgdFdBZ95bukSP5xayWbUU1Jm9EnGJpJuz-FYB9-g7ILpfZwZHYx`,
          },
          params: {
            location: 'pakistan',
            term: 'hotels',
          },
        });
        console.log('response',response)
        setHotels(response.data.businesses);
      } catch (error) {
        console.error('Error fetching hotels:', error);
      }
    };

    fetchHotels();
  }, []);

  return (
   <div>
    <h1>Hotels Nearby</h1>
    <ul>
      {hotels.map((hotel) => (
        <li key={hotel.id}>{hotel.name}</li>
      ))}
    </ul>
  </div>
  );
};

export default HotelList;
